_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2459206","type":"CustomJS"},{"attributes":{"below":[{"id":"2458997"}],"center":[{"id":"2459000"},{"id":"2459004"},{"id":"2459021"}],"height":90,"left":[{"id":"2459001"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"2459026"},{"id":"2459032"}],"sizing_mode":"stretch_width","title":{"id":"2459239"},"toolbar":{"id":"2459013"},"toolbar_location":null,"width":null,"x_range":{"id":"2458802"},"x_scale":{"id":"2458993"},"y_range":{"id":"2458991"},"y_scale":{"id":"2458995"}},"id":"2458989","subtype":"Figure","type":"Plot"},{"attributes":{"children":[{"id":"2459291"},{"id":"2459293"}],"sizing_mode":"stretch_width"},"id":"2459294","type":"Row"},{"attributes":{"axis":{"id":"2459143"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"2459146","type":"Grid"},{"attributes":{"data":{"Close":{"__ndarray__":"AAAAAAAAQkDsUbgehatBQArXo3A9qkFAZmZmZmbmQUAzMzMzM9NBQClcj8L1CEJAFK5H4Xo0QkDhehSuR0FCQOxRuB6Fi0JAKVyPwvVoQkDXo3A9CldCQNejcD0KF0JApHA9CtcDQkDD9Shcj8JBQHE9CtejEEJA7FG4HoXrQUAfhetRuP5BQClcj8L1CEJAj8L1KFwPQkBxPQrXoxBCQArXo3A9KkJAFK5H4XqUQkA9CtejcL1CQJqZmZmZuUJAH4X
